import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Bar } from 'react-chartjs-2';

ChartJS.register(
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend
);
  
export const options = {
    maintainAspectRatio: false,
    responsive: true,
};
    
export const data = {
    labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
    datasets: [
      {
        label: 'Dataset 1',
        data: [15, 23, 56, 44, 112, 98],
        backgroundColor: 'rgba(255, 99, 132, 0.5)',
      },
      {
        label: 'Dataset 2',
        data: [67, 87, 55, 66, 88],
        backgroundColor: 'rgba(53, 162, 235, 0.5)',
      },
    ],
};
  
export const Dashboard = () => {
    return (
        <div className="container">
            <Bar options={options} data={data} height={600} width={400}/>
        </div>
    )
}
